from collections import Counter
def aupto(N):
    acount = Counter()
    for i in range(1, N-1):
        for j in range(i+1, N//i + 1):
            p, s = i*j, i+j
            for k in range(j+1, (N-p)//s + 1):
                acount.update([p + s*k])
    return sorted([k for k in acount if acount[k] == 1])
print(aupto(10**5)) # _Michael S. Branicky_, Nov 14 2021

